import { transactions,dashboard,trend,expenses} from "./icons"
export const Menu_items = [
    {
        id: 1,
        title: "Dashboard",
        icon: dashboard,
        link: "/dashboard"
    },
    {
        id: 2,
        title: "View Transactions",
        icon: transactions,
        link: "/view_transactions"
    },
    {
        id: 3,
        title: "Incomes",
        icon: trend,
        link: "/incomes"
    },
    {
        id: 4,
        title: "Expenses",
        icon: expenses,
        link: "/expenses"
    }
]
